    false,nt"url": null,nt"notes": "NODC Accession 0115708 includes chemical,
    meteorological, physical and underway - surface data collected from SOUTHERN SURVEYOR
    in the Coral Sea, Great Australian Bight, Indian Ocean, South Pacific Ocean and
    Tasman Sea from 2011-04-06 to 2011-11-26 and retrieved during cruise 09ST20110406,
    09ST20110416, 09ST20110505, 09ST20110513, 09ST20110606, 09ST20110801, 09ST20110812,
    09ST20110825, 09ST20111110 and 09ST20111122. These data include AIR-SEA DIFFERENCE
    - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, CARBON
    DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide, SALINITY, SEA SURFACE
    TEMPERATURE, WIND DIRECTION and WIND SPEED. The instruments used to collect these
    data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
    for autonomous carbon dioxide (CO2) measurement. These data were collected by Bronte
    Tilbrook of Commonwealth Scientific and Industrial Research Organization as part
    of the VOS_Southern_Surveyor_2011_SS2011C01, VOS_Southern_Surveyor_2011_SS2011T01,
    VOS_Southern_Surveyor_2011_SS2011T02, VOS_Southern_Surveyor_2011_SS2011T03, VOS_Southern_Surveyor_2011_SS2011T04,
    VOS_Southern_Surveyor_2011_SS2011V01, VOS_Southern_Surveyor_2011_SS2011V02, VOS_Southern_Surveyor_2011_SS2011V03,
    VOS_Southern_Surveyor_2011_SS2011V04 and VOS_Southern_Surveyor_2011_SS2011V07 data
    set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO
    International Ocean Carbon Coordination Project (IOCCP). International groups from
    14 countries have been outfitting research ships and commercial vessels with automated
    CO2 sampling equipment to analyze the carbon exchange between the ocean and atmosphere.",nt"owner_org":
